    return (
        <div>
            <div className="Nav-bar" >
                <div className="Logo">
                    <h2 className="Logo-text">Shopi</h2>
                </div>
                <div className="Cart-section">
                    <img className="Cart-img" src={shopBag} alt="bagImage" />
                    <h3 className="Cart-text" onClick={showCart}>Cart</h3>
                </div>
            </div>

        </div>
    )

    function showCart() {
        ReactDOM.render(
            <Cart />

          );
    }
}

